import React, { Component } from 'react'
import { Link, withRouter } from 'react-router-dom'

class Nav extends Component {

 render() {
  return(
   <nav>
       <Link to="/profile">Profile</Link>
       <Link to="/login">Login</Link>
       <link to="/">Home</link>
   </nav>
    )
   }
 }



export default Nav
